function App() {
  const [todos, setTodos] = useState<Todo[]>([])

  useEffect(() => {
    // fetch('http://localhost:3001/api/todos')
    // .then(response => response.json())
    // .then(res => console.log(res))
    setTodos(getAll())
  }, [])

  return (
